The indenture governing the 2029 Notes contains covenants that, among other things, restricts our ability to:
•sell assets;
•pay dividends or make other distributions on capital stock, make payments in respect of subordinated indebtedness or make other restricted payments;
•make certain investments;
•incur or guarantee additional indebtedness or issue preferred stock;
•create certain liens;
•enter into agreements that restrict dividends or other payments from our restricted subsidiaries to us;
•consolidate, merge or transfer all or substantially all of their assets;
•enter into transactions with affiliates; and
•create unrestricted subsidiaries.
30 These covenants are subject to a number of important exceptions and qualifications. The indenture governing the 2029 Notes contains affirmative covenants and events of default that are customary for indentures governing high yield securities. The 2029 Notes and the guarantees are not subject to any registration rights agreement.
